body.script:
window.RedStone=window.RedStone||{};
(function(){
const COOKIE_NAME='redstone_cookie_consent';
const DOMAIN=window.location.hostname.includes('localhost')?'localhost':'.redstone.finance';
const COOKIE_PATTERNS={
analytics:{patterns:[/^_ga/,/^_gid/,/^_gat/,/^__utm/,/^_hj/],domains:['','.redstone.finance','.blog.redstone.finance','.app.redstone.finance']},
targeting:{patterns:[/^_fbp/,/^_fbc/,/^YSC/,/^VISITOR_INFO/,/^fr$/,/^ads/],domains:['','.youtube.com','.facebook.com','.google.com',DOMAIN]},
functional:{patterns:[/^lang/,/^theme/,/^user_pref/,/^RDST_AD_TOU/],domains:['',DOMAIN]}
};
const ESSENTIAL_PATTERNS=[/^redstone_cookie_consent/,/^session/,/^csrf/,/^auth/,/^essential/];
let consentData={necessary:true,analytics:false,targeting:false,functional:false,timestamp:0,version:'1.0',domain:'redstone.finance',userAgent:navigator.userAgent};
let originalCookieDescriptor=null;
let blockingActive=false;

function getAllCookies(){return document.cookie.split(';').reduce((cookies,cookie)=>{const[name,value]=cookie.trim().split('=');if(name)cookies[name]=decodeURIComponent(value||'');return cookies},{})}

function deleteCookie(name,domain='',path='/'){
const domains=domain?[domain]:['',window.location.hostname,DOMAIN];
const paths=[path,'/','/app','/blog'];
domains.forEach(d=>{paths.forEach(p=>{document.cookie=`${name}=;expires=Thu, 01 Jan 1970 00:00:00 UTC;path=${p}${d?`;domain=${d}`:''}`})})
}

function shouldBlockCookie(cookieName){
if(ESSENTIAL_PATTERNS.some(pattern=>pattern.test(cookieName)))return false;
for(let category in COOKIE_PATTERNS){
if(!consentData[category]&&COOKIE_PATTERNS[category].patterns.some(pattern=>pattern.test(cookieName)))return true;
}
return false;
}

function removeExistingCookies(categories){
const allCookies=getAllCookies();
categories.forEach(category=>{
if(COOKIE_PATTERNS[category]){
const{patterns,domains}=COOKIE_PATTERNS[category];
Object.keys(allCookies).forEach(cookieName=>{
if(patterns.some(pattern=>pattern.test(cookieName))){
domains.forEach(domain=>deleteCookie(cookieName,domain));
}
});
}
});
}

function initCookieBlocking(){
if(blockingActive)return;
originalCookieDescriptor=Object.getOwnPropertyDescriptor(Document.prototype,'cookie')||Object.getOwnPropertyDescriptor(HTMLDocument.prototype,'cookie');
if(!originalCookieDescriptor)return;
Object.defineProperty(document,'cookie',{
get(){return originalCookieDescriptor.get.call(document)},
set(cookieString){
const cookieName=cookieString.split('=')[0].trim();
if(shouldBlockCookie(cookieName))return cookieString;
return originalCookieDescriptor.set.call(document,cookieString);
},
configurable:true
});
blockingActive=true;
}

function updateToggles(){
document.querySelectorAll('.rs-toggle').forEach(toggle=>{
const category=toggle.dataset.category;
if(category==='necessary')return;
if(consentData[category])toggle.classList.add('active');
else toggle.classList.remove('active');
});
}

function saveConsent(){
consentData.timestamp=Date.now();
consentData.domain='redstone.finance';
const cookieValue=JSON.stringify(consentData);
document.cookie=`${COOKIE_NAME}=${encodeURIComponent(cookieValue)};path=/;domain=${DOMAIN};max-age=${365*24*60*60};SameSite=Lax;Secure=${location.protocol==='https:'}`;
}

function loadConsent(){
const cookies=getAllCookies();
if(cookies[COOKIE_NAME]){
try{
const saved=JSON.parse(decodeURIComponent(cookies[COOKIE_NAME]));
consentData={...consentData,...saved};
return true;
}catch(e){}
}
return false;
}

function applyConsent(){
const disabledCategories=Object.entries(consentData).filter(([key,value])=>key!=='necessary'&&key!=='timestamp'&&key!=='version'&&key!=='domain'&&key!=='userAgent'&&!value).map(([key])=>key);
if(disabledCategories.length>0)removeExistingCookies(disabledCategories);
initCookieBlocking();
saveConsent();
document.dispatchEvent(new CustomEvent('redstoneConsentUpdate',{detail:consentData}));
}

RedStone.openCookieSettings=function(){
updateToggles();
document.getElementById('rsCookieModal').classList.add('show');
};

RedStone.closeCookieSettings=function(){
document.getElementById('rsCookieModal').classList.remove('show');
};

RedStone.acceptAll=function(){
consentData={...consentData,analytics:true,targeting:true,functional:true};
applyConsent();
document.getElementById('rsCookieBanner').classList.remove('show');
};

RedStone.rejectOptional=function(){
consentData={...consentData,analytics:false,targeting:false,functional:false};
applyConsent();
document.getElementById('rsCookieBanner').classList.remove('show');
};

RedStone.rejectAll=function(){
consentData={necessary:true,analytics:false,targeting:false,functional:false,timestamp:Date.now(),version:'1.0',domain:'redstone.finance',userAgent:navigator.userAgent};
applyConsent();
document.getElementById('rsCookieBanner').classList.remove('show');
RedStone.closeCookieSettings();
};

RedStone.savePreferences=function(){
document.querySelectorAll('.rs-toggle:not(.disabled)').forEach(toggle=>{
const category=toggle.dataset.category;
consentData[category]=toggle.classList.contains('active');
});
applyConsent();
RedStone.closeCookieSettings();
document.getElementById('rsCookieBanner').classList.remove('show');
};

document.addEventListener('click',function(e){
const actionEl=e.target.closest('[data-rs-action]');
if(actionEl){
e.preventDefault();
const action=actionEl.getAttribute('data-rs-action');
switch(action){
case'open-settings':RedStone.openCookieSettings();break;
case'close-modal':RedStone.closeCookieSettings();break;
case'accept-all':RedStone.acceptAll();break;
case'accept-all-close':RedStone.acceptAll();RedStone.closeCookieSettings();break;
case'reject-optional':RedStone.rejectOptional();break;
case'reject-all':RedStone.rejectAll();break;
case'save-preferences':RedStone.savePreferences();break;
}
}
if(e.target.classList.contains('rs-toggle')&&!e.target.classList.contains('disabled')){
e.target.classList.toggle('active');
}
if(e.target.id==='rsCookieModal'){
RedStone.closeCookieSettings();
}
});

const hasConsent=loadConsent();
if(hasConsent){
applyConsent();
}else{
setTimeout(()=>document.getElementById('rsCookieBanner').classList.add('show'),2000);
}
})();
